export default function Details() {
  return (
    <div className="p-8 max-w-xl mx-auto">
      <h2 className="text-2xl mb-2 font-bold">Venue Info</h2>
      <p>The wedding will be held at Whispering Pines Estate, 123 Forest Lane, June 7, 2026.</p>
      <h2 className="text-2xl mt-6 mb-2 font-bold">Timeline</h2>
      <ul className="list-disc ml-6">
        <li>3:00 PM - Ceremony</li>
        <li>4:30 PM - Cocktail Hour</li>
        <li>6:00 PM - Reception</li>
        <li>9:00 PM - Dancing</li>
      </ul>
    </div>
  );
}
